import {Link} from 'react-router-dom';

const Inicio = () => {
	return (
	

		
		
		<div className="main">
		
				<div className="app1">
				
				
					<div className="text-center">
						
       

					</div>
		  
		  
				
          
				</div>
		
		
			<div className="ui container center">
				<h2>ClanMa Bienvenido</h2>
			</div>
			<div>
			
			
			<Link to="/cualnombre">
				<button className="ui button blue right">
					Continuar
				</button>
			</Link>
			</div>
		</div>
	);
};

export default Inicio;
